import styled from 'styled-components';

export const SkillContanier = styled.div`
    display: flex;
    flex-direction: column;
    width: 70%;
    padding: 5% 0;
`
export const SkillBox = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: flex-end;
`
export const SkillTitle = styled.div`
    display: flex;
    align-items: center;
    color
`
